import unittest
import base64
import os
from unittest.mock import MagicMock
from unittest.mock import patch
from io import StringIO
from intel_extension_for_transformers.neural_chat.cli.cli_commands import (
    BaseCommand, HelpCommand, TextVoiceChatExecutor, FinetuingExecutor, neuralchat_execute
)
import shutil

sample_audio_base64 = """"""

def base64_to_audio(base64_string, output_file):
    audio_data = base64.b64decode(base64_string)

    with open(output_file, 'wb') as audio_file:
        audio_file.write(audio_data)

json_data = \
"""
[
    {"instruction": "Generate a slogan for a software company", "input": "", "output": "The Future of Software is Here"},
    {"instruction": "Provide the word that comes immediately after the.", "input": "He threw the ball over the fence.", "output": "fence."}
]
"""
test_data_file = './alpaca_test.json'

class TestNeuralChatCommands(unittest.TestCase):
    def setUp(self) -> None:
        base64_to_audio(sample_audio_base64, "./sample_audio.wav")
        with open(test_data_file, mode='w') as f:
            f.write(json_data)
        return super().setUp()

    def tearDown(self) -> None:
        for filename in os.listdir("."):
            if filename.endswith(".wav"):
                os.remove(filename)
        if os.path.exists("./tmp_audio_bytes"):
            os.remove("./tmp_audio_bytes")
        if os.path.exists("./app.log"):
            os.remove("./app.log")
        shutil.rmtree('./tmp', ignore_errors=True)
        os.remove(test_data_file)
        return super().tearDown()

    def test_base_command_execute(self):
        base_command = BaseCommand()
        # Mocking sys.argv to simulate command line arguments
        with patch('sys.argv', ['neuralchat']):
            with patch('sys.stdout', new=StringIO()) as fake_out:
                result = base_command.execute([])
                output = fake_out.getvalue().strip()
                # Check if the command executed successfully and produced the expected output
                self.assertTrue(result)
                self.assertIn('Show help for neuralchat commands.\n', output)

    def test_help_command_execute(self):
        help_command = HelpCommand()
        # Mocking sys.argv to simulate command line arguments
        with patch('sys.argv', ['neuralchat', 'neuralchat.help']):
            with patch('sys.stdout', new=StringIO()) as fake_out:
                result = help_command.execute([])
                output = fake_out.getvalue().strip()
                # Check if the help command executed successfully and produced the expected output
                self.assertTrue(result)
                self.assertIn('Commands:', output)

    def test_text_chat_executor_execute(self):
        # Test for TextVoiceChatExecutor class execute method
        # Create a mock argument list
        argv = ['--query', 'Tell me about Intel Xeon processors.', '--model_name_or_path', 'facebook/opt-125m', '--device', 'cpu']
        chat_executor = TextVoiceChatExecutor()
        # Mocking sys.argv to simulate command line arguments
        with patch('sys.argv', ['neuralchat.predict'] + argv):
            # Mocking build_chatbot function call to avoid actual execution
            result = chat_executor.execute(argv)
            # Check if the executor executed successfully
            self.assertTrue(result)

    def test_voice_chat_executor_execute(self):
        # Test for TextVoiceChatExecutor class execute method
        # Create a mock argument list
        argv = ['--query', './sample_audio.wav', '--device', 'cpu', '--model_name_or_path', 'facebook/opt-125m']
        chat_executor = TextVoiceChatExecutor()
        # Mocking sys.argv to simulate command line arguments
        with patch('sys.argv', ['neuralchat.predict'] + argv):
            result = chat_executor.execute(argv)
            # Check if the executor executed successfully
            self.assertTrue(result)

    def test_finetuing_executor_execute(self):
        # Test for FinetuingExecutor class execute method
        # Create a mock argument list
        argv = ['--base_model', 'facebook/opt-125m', '--device', 'cpu', '--train_file', './alpaca_test.json', '--max_steps', '3']
        finetune_executor = FinetuingExecutor()
        # Mocking sys.argv to simulate command line arguments
        with patch('sys.argv', ['neuralchat.finetune'] + argv):
            # Mocking finetune_model function call to avoid actual execution
            result = finetune_executor.execute(argv)
            # Check if the executor executed successfully
            self.assertTrue(result)

    def test_neuralchat_execute(self):
        # Test for neuralchat_execute function
        # Mocking sys.argv to simulate command line arguments
        with patch('sys.argv', ['neuralchat']):
            # Mocking execute method call to avoid actual execution
            with patch('intel_extension_for_transformers.neural_chat.cli.cli_commands.get_command') as mock_get_command:
                # Create a MagicMock object to simulate a command
                mock_command = MagicMock()
                # Set the execute method of the mock command
                mock_command.execute.return_value = True
                # Mocking get_command to return the mock command
                mock_get_command.return_value = mock_command

                # Call neuralchat_execute and check the result
                result = neuralchat_execute()
                # Check if the function executed successfully
                self.assertEqual(result, 0)

if __name__ == '__main__':
    unittest.main()
